{
  "swagger": "2.0",
  "info": {
    "title": "DFØ API",
    "version": "2.0",
    "description": "Datamodellene som er beskrevet her skal være generiske og dekkende for tilgang på data om person, organisasjon og stilling hos DFØ sine kunder.\n* Ansatte, gjester og innleide (gyldighet i dag - hvis ingen gyldig post i dag, hent første gyldige post, eller siste gyldige post 30 dager tilbake i tid. Personer forsvinner fra grensesnittet 30 dager etter fratredelse. Default er spørring på dagens dato, men det er mulig å endre dato for spørring frem eller tilbake i tid. Da vil backend forholde seg til denne datoen som dagens dato. Eksempelvis vil det i 2022 være mulig å spørre på en person tilbake til 01.01.2021 selv om personen fratrådte 30.05.2021. Det vil også være mulig å spørre på en person 01.05.2021, selv om personen ikke tiltrer før 01.09.2021). \n* Lokasjoner (kun i bruk for SVV - ingen informasjon om dette i denne filen)\n* Stillinger (Henter stillingens navn og alle definerte knytninger som er gyldige fra i dag, og i all fremtid. Det vil også være mulig å definere 'innlest dato' for å hente historiske poster).\n* Orgenheter\n\nUpdate log\n1.0    Initial versions\n1.1    Updated on 18.02.2019\n1.2    Updated \n2.0 Oppdatert til å være generisk og gyldig for BOTT, og mer innledende definisjoner."
  },
  "host": "gw-uio.intark.uh-it.no",
