                }
              }
            }
          }
        ],
        "tags": [
          "Ansatte"
        ],
        "description": "Oppdater epostadresse og brukerident, samt andre data hvor kundene er eier av relevant data, på ansatt, innledig eller gjest.\nBenyttes av kunde for å sette disse verdiene i systemet hos DFØ.\nKunde er master for brukerident og epostadresse hentes fra AD, eller tilsvarende løsninger hos kundene.",
